import React from "react";
import Grid from "@material-ui/core/Grid";

const RmText = ({type}) => {
    console.log(type);
    return (
        <Grid container item>
            <p>
                {type?
                "Hey There! Please login to your account":
                "Hey There! Please sign-up"}
            </p>
        </Grid>
    )
}

export default RmText;
